function App() {
  return (
    <div className="App">
      {/* <MediaFeed/> */}
      <Router>
        <div className="container my-3">
          <Routes>
            <Route path="/" element={<SignIn />}>
            </Route>
            <Route path="login" element={<SignIn />}>
            </Route>
            <Route path="register" element={<Signup />}>
            </Route>
      <MainPage/>
          </Routes>
        </div>
      </Router>
    </div>
  );
}

